import logo from './logo.svg';
import './styles/App.css';
import Header from './components/Header'
import Row from './components/Row'


function App() {
  return (
    <>
      <Header />
      <Row />
      <Upload />
      <Video />
      <Title />
      <SubTitle />
      <Description />
      <Comments />
      <NextVideos />
    </>
  );
}

export default App;
